import React from 'react';
import {useState} from 'react';
import ReactDOM from 'react-dom/client';
import { Link } from "react-router";



export default function Page2() {

    const [inputs, setInputs] = useState({});
    const handleChange = (event) => {
        const name = event.target.name;
        const value = event.target.value;
        setInputs(values => ({...values, [name]: value}))
      }
      const handleSubmit = (event) => {
        event.preventDefault();  
      }

    return (

<body>
            <header><h1>MedLab Registration Form</h1></header>
            <form onSubmit={handleSubmit}>
            <h2>Patient information</h2>
                <label class="labels">First Name:</label>
                <input class="inputs" 
                    type="text"
                    name="first_name"
                    value={inputs.first_name || ""} 
                    onChange={handleChange}
                />
                <br/>
                <label class="labels">Last Name:</label>
                <input class="inputs" 
                    type="text"
                    name="last_name"
                    value={inputs.last_name || ""}
                    onChange={handleChange}
                />
                <br/>
                <label class="labels">Email:</label>
                <input class="inputs" 
                    type="email"
                    name="email"
                    value={inputs.email || ""}
                    onChange={handleChange}
                />
                 <br/>
                <label class="labels">Phone Number:</label>
                <input class="inputs"
                    type="tel"
                    name="phone"
                    value={inputs.phone || ""}
                    onChange={handleChange}
                />
                <br/>
                <label class="labels">Address:</label>
                <input class="inputs" 
                    type="text"
                    name="address1"
                    value={inputs.address1 || ""}
                    onChange={handleChange}
                />
                <label class="labels">Address line 2:</label>
                <input class="inputs" 
                    type="text"
                    name="address2" 
                    value={inputs.address2 || ""}
                    onChange={handleChange}
                    />
                 <br/>
                <label class="labels">City:</label>
                <input class="inputs" 
                    type="text"
                    name="city" 
                    value={inputs.city || ""}
                    onChange={handleChange}
                />           
                 <br/>
                <label class="labels">State:</label>
                <input class="inputs" 
                    type="text"
                    name="state" 
                    value={inputs.state || ""}
                    onChange={handleChange}
                />
                <br/> <br/>
                <label class="labels">Zip code:</label>
                <input class="inputs" 
                    type="number"
                    name="zip" 
                    value={inputs.zip || ""}
                    onChange={handleChange}
                />
                <br/> <br/>
                <Link to="/page1">
                    <input  type="button" value="Go Back" />
                </Link>
                <Link to="/page3">
                    <input type="submit" value="Next" />
                </Link>
            </form>
            <footer>
                    <div id="address">MedLab Medical Clinics of America <br/>
                         1074 Jadewood Drive, Suite 330 <br/>
                         Chicago, Illinois 60647 <br/>
                    </div>
                     <div id="contact">
                         Phone: 630-921-0000 <br/>
                         Fax: 773-709-3312
                    </div>
             </footer>
                
            
        </body>
    )
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
 <Page2/>
);
